	function cmbSelect(str)//默认计算
	{
		function setdata(e){
			_defthis[e.level-1].id=e.id;
			_defthis[e.level-1].name=e.name;
			_defthis[e.level-1].pid=e.pid;
			_defthis[e.level-1].level=e.level;
		}
		for(var i=0; i<provinceList.length; i++)
		{
			if(provinceList[i].id == str)
			{				
				setdata(provinceList[i]);
				for(var a=0; a<provinceList.length; a++){
					if(provinceList[i].pid == provinceList[a].id){
						setdata(provinceList[a]);
						for(var b=0; b<provinceList.length; b++){
							if(provinceList[a].pid == provinceList[b].id){
								setdata(provinceList[b]);
							}
						} 
					}
				}
				//console.log(_defthis);
				setSelectChecked(cmbProvince,_defthis[0].id);			
			}
		}		
	}		
	function setSelectChecked(cmb, str)//默认
	{
		for(var i=0; i<cmb.options.length; i++)
		{
			if(cmb.options[i].value == str)
			{
				cmb.selectedIndex = i;				
				return;
			}
		}
	}	
	function cmbAddOption(cmb, str, obj)//值
	{
		var option = document.createElement("OPTION");
		cmb.options.add(option);
		option.innerHTML = str;
		option.value = obj.id;
		option.obj = obj;
	}	
	function changeCity()//县
	{	
		if(cmbCity.value!=""){
		var infotext=cmbCity.value==""?_default:cmbCity.value;
		document.getElementById(_defid).value=infotext;
		}
		if(cmbArea==undefined){return false;}
		cmbArea.options.length = 0;
		if(cmbCity.selectedIndex == -1)return;
		var item = cmbCity.options[cmbCity.selectedIndex].obj;	
		cmbAddOption(cmbArea, "请选择区",{id:""});
		for(var i=0; i<provinceList.length; i++)
		{
			if(provinceList[i].pid==item.id){
				cmbAddOption(cmbArea, provinceList[i].name, provinceList[i]);
			}
			
		}
		setSelectChecked(cmbArea, _defthis[2].id);
		cmbArea.onchange=function(){
			if(cmbArea.value!="") document.getElementById(_defid).value=cmbArea.value;
			
		} 
	}
	function changeProvince()//市 
	{
		var infotext=cmbProvince.value==""?_default:cmbProvince.value;
		document.getElementById(_defid).value=infotext;
		if(cmbCity==undefined){return false;}
		cmbCity.options.length = 0;
		cmbCity.onchange = null;
		if(cmbProvince.selectedIndex == -1)return;
		//cmbAddOption(cmbCity, "请选择市",{id:""});
		var fata=false,
			cmdobg=null;
		var item = cmbProvince.options[cmbProvince.selectedIndex].obj;
		for (var a = 0 ; a < provinceFata.length; a++ ) {
			if(provinceFata[a].id==item.id){				
				fata=true;
				cmdobg=provinceFata[a];
			}
		}
		itemfn(cmdobg);
		function itemfn(obj){
			if(fata){
				cmbAddOption(cmbCity, obj.name, obj);
				changeCity();
				cmbCity.onchange = changeCity;
				fata = false;
			}else{
				
				for(var i=0; i<provinceList.length; i++)
				{
					if(provinceList[i].pid==item.id){
						cmbAddOption(cmbCity, provinceList[i].name, provinceList[i]);
					}
				}
				setSelectChecked(cmbCity, _defthis[1].id);		
				changeCity();
				cmbCity.onchange = changeCity;	
			}
		}
		
			
	}
	
